import React from "react";
import { Switch, Route } from "react-router-dom";
import Home from "./components/Home";
import Navbar from "./components/Navbar";
import Track from "./components/Track";
import List from "./components/List";
function App() {
  return (
    <>
      <Navbar />
      <Home />
      {/* <Track/> */}

      <Route path="/">
        <Navbar />
        <Home />
      </Route>
      <Route path="/:user">
        <User />
      </Route>
      <Route>
        <NoMatch />
      </Route>
    </>
  );
}

export default App;
